import React from "react";
import "./Login.css";
import { Link } from "react-router-dom";
function Login() {
  return (
    <div className="login">
      <Link to="/">
        <img
          className="login_logo"
          src="https://i.pinimg.com/originals/18/e1/80/18e180218bdac1685b79197c9023259b.png"
        />
      </Link>
    </div>
  );
}

export default Login;
